def find_center(image, color1, color2):
    points1, points2 = [0,0], [0, 0]
    total_points1, total_points2 =  0, 0
    (h, w, _) = np.shape(image)
    for i in range(h):
        for j in range(w):
            if np.array_equal(image[i][j], color1):
                points1[0] += i
                points1[1] += j
                total_points1 += 1
            if np.array_equal(image[i][j], color2):
                points2[0] += i
                points2[1] += j
                total_points2 += 1
    points1 = [points1[0]//total_points1, points1[1]//total_points1]
    points2 = [points2[0]//total_points2, points2[1]//total_points2]
    return points1, points2

def vertical_flag(template, center_saffron, center_green):
    if center_saffron > center_green :
        return cv2.rotate(template, cv2.ROTATE_180)
    else :
        return template
    
def horizontal_flag(template, center_saffron, center_green):
    if center_saffron > center_green:
        return cv2.rotate(template, cv2.ROTATE_90_CLOCKWISE)
    else :
        return cv2.rotate(template, cv2.ROTATE_90_COUNTERCLOCKWISE)

